抓取 = false;
抓取目标 = "";
抓取方向 = "";
Z轴抓取范围 = 60;

function 抓取持续判定() {
	//!_root.gameworld[抓取目标].刚体
	//现在可以抓取霸体敌人
	return (抓取 && !_root.gameworld[抓取目标].倒地 && _root.gameworld[抓取目标].hp > 0);
}
function 持续抓取(){
	if (!抓取持续判定() or _parent.方向 != 抓取方向) {
		抓取 = false;
		return;
	}
	var target = _root.gameworld[抓取目标];
	var myPoint = {x:this.抓取点._x, y:this.抓取点._y};
	this.localToGlobal(myPoint);
	_root.gameworld.globalToLocal(myPoint);
	var shootX = myPoint.x;

	var vx = shootX - target._x;
	var vz = _parent.Z轴坐标 - target.Z轴坐标 - 1;
	var dx = "右";
	var dz = "下";
	if(vx < 0){
		dx = "左";
		vx = -vx;
	}
	if(vz < 0){
		dz = "上";
		vz = -vz;
	}
	target.强制移动(dx,vx);
	target.强制移动(dz,vz);

	if(target.浮空){
		target._y = target.Z轴坐标 - 10;
	}else{
		target._y = target.Z轴坐标;
	}
}

if (蓄力 && 蓄力>=20 && Math.abs(_parent.Z轴坐标 - _root.gameworld[_parent.攻击目标].Z轴坐标) < Z轴抓取范围 && _root.gameworld[_parent.攻击目标].area.hitTest(this.抓取碰撞箱))
{
	//!_root.gameworld[_parent.攻击目标].刚体
	if (!_root.gameworld[_parent.攻击目标].倒地 && _root.gameworld[_parent.攻击目标].hp > 0)
	{
		抓取 = true;
		抓取目标 = _parent.攻击目标;
		抓取方向 = _parent.方向;
		break;
	}
}

if (!抓取 && 蓄力 && 蓄力>=20 && Math.abs(_parent.Z轴坐标 - _root.gameworld[_parent.攻击目标].Z轴坐标) < Z轴抓取范围 && _root.gameworld[_parent.攻击目标].area.hitTest(this.抓取碰撞箱))
{
	//!_root.gameworld[_parent.攻击目标].刚体
	if (!_root.gameworld[_parent.攻击目标].倒地 && _root.gameworld[_parent.攻击目标].hp > 0)
	{
		抓取 = true;
		抓取目标 = _parent.攻击目标;
		抓取方向 = _parent.方向;
		break;
	}
}

onClipEvent(enterFrame){
   _parent.攻击时移动(_parent._parent.跑X速度 * 2,_parent._parent.跑X速度 * 2);
}

onClipEvent (enterFrame) {
	if (_parent._parent._name == _root.控制目标)
	{
		//Key.isDown(_parent._parent.A键)更换为_parent._parent.动作A
		/*
		if (_parent._parent.被动技能.上挑 && _parent._parent.被动技能.上挑.启用 && _parent._parent.动作A && _parent._parent.动作B)
		{
			_parent._parent.状态改变("兵器跳");
		}
		*/
		if (!_parent._parent.飞行浮空 && _parent._parent.动作B)
		{
			_parent._parent.状态改变("空手跳");
		}

	}
}

onClipEvent (load) {
	_parent.当前初始帧 = _parent._currentframe;
	_parent.蓄力 = 0;
	if (_parent._parent.火箭重拳 && _parent._parent.火箭重拳许可 && _parent._currentframe == _parent.当前初始帧 && Key.isDown(_parent._parent.A键))
	{
		_parent._parent.火箭重拳蓄力中 = true;
		_parent.stop();
	}
	this.onUnload = function()
	{
		_parent._parent.火箭重拳蓄力中 = false;
		_parent.play();
	};
}
onClipEvent (enterFrame) {
	if (_parent._parent.火箭重拳 && _parent._parent.火箭重拳许可 && Key.isDown(_parent._parent.A键) && _parent._currentframe == _parent.当前初始帧 && _parent.蓄力 < 45)
	{
		_parent.stop();
		_parent._parent.火箭重拳蓄力中 = true;
		_parent.蓄力 += 1;
	}
	else
	{
		_parent._parent.火箭重拳蓄力中 = false;
		_parent.play();
	}
}
