onClipEvent(load){
	子弹属性 = _root.子弹属性初始化(this);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 3;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战联弹";
	子弹属性.子弹威力 =  _parent._parent.空手攻击力 * 1;
	if(_parent._parent.mp攻击加成){
		子弹属性.子弹威力 += _parent._parent.mp攻击加成;
	}
	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 1;
	if(_parent.蓄力){
		子弹属性.霰弹值 += Math.floor(_parent.蓄力 / 10);
		if(_parent.蓄力 >= 20){
				子弹属性.暴击 = function(当前子弹)
				{
					_root.gameworld[当前子弹.发射者名].攻击目标 = 当前子弹.hitTarget._name;
					return 2;
				};
		}
	}
	子弹属性.水平击退速度 = 20;

	//非常用
	/*
	子弹属性.水平击退速度 = NaN;
	子弹属性.垂直击退速度 = NaN;
	子弹属性.发射效果 = "";
	子弹属性.击中地图效果 = "火花".
